import ReactDOM from 'react-dom/client';
import React, { useEffect } from "react";
import { useHistory, useLocation, useNavigate } from "react-router-dom";
import './index.css';
import App from './App';
import 'bootstrap/dist/css/bootstrap.min.css';
import reportWebVitals from './reportWebVitals';

// const root = ReactDOM.createRoot(document.getElementById('root'));

// root.render(
//     <App />
//   );

export function Root() {
  // const history = useHistory();
  const history = useNavigate();
  useEffect(() => {
    console.log("changed page to" + history.pathname);
    console.log("changed page to (window.location)" + window.location.pathname);
    return history.listen((location) => {
      console.log("changed page to " + location.pathname);
    })
  }, [history, window.location]);
  // return ReactDOM.createRoot(document.getElementById('root'));
  
  return ReactDOM.createRoot(document.getElementById("root")).render(<App />);
}

